get data out of array in mongo query<p>I have a query (<code>db.vehicles.find( {}, { 'cars.model': 1 } )</code>) that gets me some data that looks like</p>

<pre class="lang-js prettyprint-override"><code>{
  _id: ObjectId(...),
  cars: [
    {
      model: 'foo'
    }
  ]
}
{
  _id: ObjectId(...),
  cars: [
    {
      model: 'foo'
    },
    {
      model: 'bar'
    }
  ]
}
</code></pre>

<p>but I would really like to to have it return something like</p>

<pre><code>{
  _id: ObjectId(...),
  cars: [ 'foo' ]
}
{
  _id: ObjectId(...),
  cars: [ 'foo', 'bar' ]
}
</code></pre>

<p>or at least something where the data isn't as nested. I can't seem to figure out how to do this with mongo as I'm relatively new to it.</p>

<p>I'm also wondering if maybe you aren't supposed to do this sort of thing in mongo as it seems most queries kind of leave the data as is, but just get you the data you have, but filtered. Maybe I'm bringing too many PostgreSQL ideas to my attempt of a mongo query.</p>

