  // Declaring everything that is not in the GraphQL Schema for a User
  _id: string; // TODO: This should actually be Types.ObjectId
  password: string;
  lowercaseUsername: string;
  lowercaseEmail: string;
  passwordReset?: {
    token: string;
    expiration: Date;
  };

  checkPassword(password: string): Promise&lt;boolean&gt;;
}
</code></pre>

<p>I can't define the _id as a mongoose.Type.ObjectID because it produces the error: </p>

<pre><code>Interface 'UserDocument' incorrectly extends interface 'User'.
  Types of property '_id' are incompatible.
    Type 'ObjectId' is not assignable to type 'string'.
</code></pre>

<p>This makes sense, I'd like to find a way to keep it as an ObjectId on my UserDocument schema, keep it as a String in the Schema, and still be able to extend the GraphQL schema type. Is this possible?</p>; Answer: Object oriented design is about responsibilities. Somebody need to be responsible to hold and maintain access to your Boos. Maybe Foo, maybe the Boo class, maybe some other class, maybe even a global variable. It depends on your problem. Just misusing ObjectSpace is the worst option.

