Alexa: We were unable to link * at this time - Node, OAuth2 & MongoDB<p>After I tried to connect my user account, which is stored in a MongoDB database with Alexa it's account linking function, the confirmation page says that "<strong>We were unable to link * at this time</strong>".</p>

<p>The OAuth2 server I run is made up from this tutorial: <a href="https://medium.com/@henslejoseph/building-a-restful-api-with-node-oauth2-server-4236c134be4" rel="nofollow noreferrer">Building a RESTful API With NodeOAuth2 Server</a></p>

<p>The whole authentication flow is working properly and even an access token (called value) is stored in my database.</p>

<hr>

<p>I think that this is the most important code block, since everything works til here, I think.</p>

<p><strong>server.exchange</strong></p>

<pre><code>server.exchange(oauth2orize.exchange.code(function(client, code, redirectUri, callback) {
  Code.findOne({ value: code }, function (err, authCode) {
    if (err) { return callback(err); }
    if (authCode === undefined) { return callback(null, false); }
    if (client._id.toString() !== authCode.clientId) { return callback(null, false); }
    if (redirectUri !== authCode.redirectUri) { return callback(null, false); }

    // Delete auth code now that it has been used
    authCode.remove(function (err) {
      if(err) { return callback(err); }

      // Create a new access token
      var token = new Token({
        value: uid(256),
        clientId: authCode.clientId,
        userId: authCode.userId
      });

      // Save the access token and check for errors
      token.save(function (err) {
        if (err) { return callback(err); }

        callback(null, token);
      });
    });
  });
}));
</code></pre>

<hr>

<p>These are my nginx access logs:</p>

<pre><code>77.182.19.18 - dmnktoe [10/Mar/2019:15:12:27 +0100] "GET /api/oauth2/authorize?redirect_uri=https://layla.amazon.com/api/skill/link/*&amp;client_id=amazonEchoServices&amp;response_type=code&amp;state=*very-long-state-value* HTTP/1.1" 200 525

77.182.19.18 - dmnktoe [10/Mar/2019:15:12:29 +0100] "POST /api/oauth2/authorize HTTP/1.1" 302 1520 "https://oauth2.healform.de/api/oauth2/authorize?redirect_uri=https://layla.amazon.com/api/skill/link/*&amp;client_id=amazonEchoServices&amp;response_type=code&amp;state=*very-long-state-value*"

54.240.197.10 - amazonEchoServices [10/Mar/2019:15:12:29 +0100] "POST /api/oauth2/token HTTP/1.1" 200 434 "-" "Apache-HttpClient/4.5.x (Java/1.8.0_192)"
</code></pre>

<p>Hope anyone can help.</p>

<hr>

<p><strong>Update</strong>: Bit funny, but all Amazon/Alexa need was just the value inside my token object. So callback(null, token); became callback(null, token.value);.</p>

